import React, { useContext } from "react";
import ProjectProvider from "../projects";
import { Link } from "react-router-dom";

function CaseStudy() {
  const { work } = useContext(ProjectProvider);
  return (
    <div>
      <Link to="/">Go Back</Link>
      <h3>{work.title}</h3>
    </div>
  );
}

export default CaseStudy;
